import React from "react";
import { Grid } from "@material-ui/core";
function Card(props){
    return(
        <>
        <Grid item xs = {12} container spacing = {5}>
        <Grid item lg = {4} md = {4} sm = {12} xs = {12}>       
        <img src = {props.icon}/>
        <h1>{props.service}</h1>
        <p>{props.discription}</p>
        </Grid>
        </Grid>
        </>
    );

}
export default Card;
